import React, { useEffect, useState } from 'react';
import ReactPlayer from "react-player"

function Player() {

  const [urlValue, setUrlValue] = useState('');
  useEffect(() => {
    console.log('i am inside useEffect')
    fetch("http://take-home-assignment.tempo.fit/video.json")
      .then(res => res.json())
      .then(result => setUrlValue(result.videoUrl))
  })

  return (
    <div className="mx-auto" style={{ "width": "800px" }}>
      <p>this is url {urlValue}</p>
      <ReactPlayer url={urlValue} controls width='100%' height='100%' />
    </div>
  )
}

export default Player;
